INSERT INTO `product_tab` VALUES ('427', 'Tournament Basic Package', '1', '1000.00', '<html>\r\n<head><meta name=\"qrichtext\" content=\"1\" />\r\n</head>\r\n<body style=\" font-family:\'MS Shell Dlg 2\';font-weight:400; font-size:10pt; font-style:normal;\">\r\n<p align=\'center\'><span style=\" font-size:12pt; color:#000000;  font-weight:600;\">Game HON 5v5</span></p>\r\n<p ><span style=\" font-size:12pt; color:#ff0000;\">รางวัล<br/></span></p>\r\n<span style=\"font-weight:600;\">รางวัลชนะเลิศ<br/></span><span style=\" font-size:10pt;\">เสื้อยืด 5 ตัว , Wristband 5 เส้น และไอเทมโค้ด 5 โค้ด<br /></span>\r\n<span style=\"font-weight:600;\">Lucky draw<br/></span><span style=\" font-size:10pt;\">เสื้อยืด 1 ตัว และWristband 5 เส้น<br /></span>\r\n<span style=\"font-weight:600;\">สิทธิพิเศษสำหรับผู้ร่วมกิจกรรม<br/></span><span style=\" font-size:10pt;\">เติม Garena Prepaid Card (แบบ Direct Top-Up ) รับเพิ่มเชลล์ 10% ช่วงเที่ยงวัน ถึงเที่ยงคืน ที่ร้านของคุณลูกค้า<br /></span>\r\n<p ><span style=\" font-size:12pt; color:#ff0000;\">สิทธิประโยชน์ที่คุณจะได้รับ<br/></span></p>\r\n<span style=\"font-weight:600;\">การโปรโมทผ่าน Website<br/></span><span style=\" font-size:10pt;\">ได้แก่ CafeThai Tournament และ CafeThai<br /></span>\r\n<span style=\"font-weight:600;\">การโปรโมทผ่าน Facebook Post<br/></span><span style=\" font-size:10pt;\">ได้แก่ CafeThai Tournament , Garena Thailand , Garena Premium Café และ AirPay Counter<br /></span>\r\n<span style=\"font-weight:600;\">แผ่นติดประกาศ 2 แผ่น<br /></span>\r\n<span style=\"font-weight:600;\">X-Stand ติดตั้งไว้ในวันงาน<br /></span>\r\n<p ><span style=\" font-size:12pt; color:#ff0000;\">รายละเอียดเพิ่มเติม </span><span style=\" font-size:12pt; color:#0033cc;\">http://tour.cafethai.com/package<br /></span>\r\n<span style=\" font-size:10pt;\">หลังจากสั่งซื้อแพคเกจ ผ่านโปรแกรม AirPay เคาน์เตอร์ เจ้าหน้าที่จะติดต่อกลับภายใน 24ชั่วโมงยกเว้นการสั่งซื้อในวันเสาร์ และวันอาทิตย์ เจ้าหน้าที่จะติดต่อกลับไปในวันจันทร์ <br/><b><u><font color=\"red\">*กรุณาทำการสั่งซื้อ ณ ร้านที่ต้องการจัด CafeThai Tournament Package เท่านั้น*</font></b></u> เนื่องจากการรับเชลล์โบนัสเพิ่มขึ้น 10% จะได้เฉพาะที่ร้านที่ทำการสั่งซื้อแพคเกจเท่าน้ัน</span>\r\n</p></span></p>', '0', 'cafepackage', '50201', '1000.00', 'Cafe_Products', '0', '0', '', '0', '0', '0', '0', '0', null, null);
